import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';


const Carte = props => (
	<section className="my-5">
		<script>
			{function delta(){
				var delta  = document.getElementById('delta').value;
				delta.innerHTML = "Voila delta"
			}}
		</script>
			<div className="row view-group" id="colonne"> 
					{props.users.length > 0 ? (

					props.users.map(user => (

			<div class="item col-xs-4 col-lg-4">

  		<div className="card card-cascade narrower card-ecommerce">

			<div class="view view-cascade overlay">

        </div>

			<div className="card-body card-body-cascade">

					<h6 id="description">a = &nbsp;{Math.sqrt(user.a, 2)}</h6>

					<h6 id="description">b = &nbsp;{user.b}</h6>

					<h6 id="description">c = &nbsp;{user.c}</h6>

					<h4 id="delta"></h4>
	  	<div className="card-footer px-1">
	  </div>
	</div>

  </div><br/><br/>
 </div>

		))
	) : (
		<div></div>
	)}
</div>
	</section>
)

export default Carte
